import React from "react";
import componentStyle from "./index.module.css";
import ArrowBtn from "./component/ArrowBtn";

export default class MainModule extends React.Component {
  firstStyle = `
    background-color: rgba(255, 255, 255, 0.3);
    backdrop-filter: blur(10px);
    width: 10%;
    height: 60%;
    left: -10%;
    top: 20%;
  `;

  secondStyle = `
    background-color: rgba(255, 255, 255, 0.3);
    backdrop-filter: blur(10px);
    width: 10%;
    height: 60%;
    left: -10%;
    top: 20%;
  `;

  thirdStyle = `
    background-color: rgba(255, 255, 255, 0.3);
    backdrop-filter: blur(10px);
    width: 10%;
    height: 60%;
    left: -10%;
    top: 20%;
  `;

  forthStyle = `
    background-color: rgba(255, 255, 255, 0.3);
    backdrop-filter: blur(10px);
    width: 10%;
    height: 60%;
    left: -10%;
    top: 20%;
  `;
  fifthStyle = `
background-color: rgba(255, 255, 255, 0.3);
backdrop-filter: blur(10px);
width: 10%;
height: 60%;
left: -10%;
top: 20%;
`;

  render() {
    return (
      <div>
        <div className={componentStyle.container}>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
        </div>
        <div className={componentStyle.leftArrowBtn}>
          <ArrowBtn />
        </div>
        <div className={componentStyle.rightArrowBtn}>
          <ArrowBtn />
        </div>
      </div>
    );
  }
}
